import React, { useState } from "react";

import { MDBInput, MDBBtn, MDBContainer, MDBCol, MDBRow } from "mdb-react-ui-kit";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { Radio, FormControl, FormControlLabel, FormLabel, RadioGroup } from "@mui/material";

const Create = () => {
  const navigate = useNavigate()
  const [user,setUser] = useState({name:"",email:"",mobile:"",address:"",status:""});
  const handleChange = (e)=>{
    setUser({...user,[e.target.name]:e.target.value})

  }

  const handleSubmit = async (e)=>{
         e.preventDefault()
         try{
          if(!user.name || !user.email || !user.mobile || !user.address || !user.status)
          {
            navigate('/submit')
          }
          else
          {
            await axios.post(`http://localhost:4000/users`,
            {
              name:user.name,
              email:user.email,
              mobile:user.mobile,
              address:user.address,
              status:user.status
            })
          }
         }
         catch
         {
          console.log("Something is Went Wrong")
         }
         setUser({name:"",email:"",mobile:"",address:"",status:""})
  }
  return (
    <>
      <MDBContainer style={{backgroundImage:"url()"}}>
        <form className="pt-4" onSubmit={handleSubmit}>
       
        <MDBRow size='12'>
        <MDBCol size='3'></MDBCol>
        <MDBCol size='6'>
        <h1 style={{backgroundColor:"orange",borderRadius:"5px"}}> 1. What Is Your Name ?</h1>
        <MDBInput name="name" type="text" wrapperClass="mb-4" label="Name" onChange={handleChange} />
        </MDBCol>
        </MDBRow>

        <MDBRow>
          <MDBCol size='3'></MDBCol>
          <MDBCol size='6'>
          <h1 style={{backgroundColor:"orange",borderRadius:"5px"}}> 2. What Is Your Email ?</h1>
          <MDBInput name="email" type="email" wrapperClass="mb-4" label="Email address" onChange={handleChange} />
          </MDBCol>
        </MDBRow>

        <MDBRow>
          <MDBCol size='3'></MDBCol>
          <MDBCol size='6'>
          <h1 style={{backgroundColor:"orange",borderRadius:"5px"}}>What is Your Phone</h1>
          <MDBInput name="mobile" type="tel" wrapperClass="mb-4" label="Phone" onChange={handleChange} />
          </MDBCol>
        </MDBRow>

       <MDBRow>
        <MDBCol size='3'></MDBCol>
        <MDBCol size='6'>
   <h1 style={{backgroundColor:"orange",borderRadius:"5px" ,textAlign:""}}>What is your Address</h1>
        <MDBInput name="address" type="text" wrapperClass="mb-4" label="Address" onChange={handleChange} />
        </MDBCol>
       </MDBRow>

        <MDBRow>
          <MDBCol size='3'></MDBCol>
          <MDBCol size='6'>
          <h1 style={{backgroundColor:"orange",borderRadius:"5px"}}> What is Your Status</h1>
          <FormControl>
      <FormLabel id="demo-controlled-radio-buttons-group">Gender</FormLabel>
      <RadioGroup
        aria-labelledby="demo-controlled-radio-buttons-group"
        name="status"
        onChange={handleChange}
      >
        <FormControlLabel value="Active" control={<Radio />} label="Active" />
        <FormControlLabel value="Inactive" control={<Radio />} label="Inactive" />
      </RadioGroup>
    </FormControl>


          
          {/* <MDBInput name="status" type="text" wrapperClass="mb-4" label="Status" onChange={handleChange} /> */}
          </MDBCol>
        </MDBRow>
             
             <MDBRow>
              <MDBCol size='3'></MDBCol>
              <MDBCol size='6'>
              <MDBBtn type="submit" className="mb-4" block color="success">
               Add User
              </MDBBtn>
              </MDBCol>
             </MDBRow>
        </form>
      </MDBContainer>
    </>
  );
};

export default Create;
